import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the featured products grid (uses ID selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Use XPath to select the first product card by its title text (e.g., "Apple iPhone 15 Pro Max")
    // This avoids relying on class or ID, and is different from previous attempts
    const productTitle = "Apple iPhone 15 Pro Max, 256GB, Natural Titanium";
    const productCardXPath = `//h3[contains(@class,"product-title") and contains(text(),"${productTitle}")]/ancestor::div[contains(@class,"product-card")]`;
    const [productCard] = await page.$x(productCardXPath);

    if (!productCard) {
      throw new Error('Product card for iPhone 15 Pro Max not found');
    }

    // Scroll into view and click the product card to open the modal
    await productCard.scrollIntoViewIfNeeded();
    await productCard.click();

    // Wait for the product modal to appear (modal has id="productModal" and style.display='block')
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for the modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot of the opened modal
    const step2 = path.join(screenshotsDir, 'step_2_modal_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract product detail modal title and price for verification
    const modalTitle = await page.$eval('#productModal .product-detail-title', el => el.textContent.trim());
    const modalPrice = await page.$eval('#productModal .product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened the Product Detail Modal for 'Apple iPhone 15 Pro Max, 256GB, Natural Titanium'",
      extractedData: {
        modalTitle,
        modalPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
